import React, { useContext } from "react";

import { makeStyles, TextField } from "@material-ui/core";

import SearchIcon from "@material-ui/icons/Search";

import { FlexWrapper, InputWrapper } from "../../../styled/containers";

import { ContactsToolbarContext } from "../../../pages/ContactsListPage";

const useStyles = makeStyles({});

export const ContactListSearch = () => {
  const { searchValue, setSearchValue } = useContext(
    ContactsToolbarContext
  ).searchContext;

  const classes = useStyles();

  return (
    <FlexWrapper justifyContent="space-between">
      {/* <InputWrapper width="auto">
        <InputLabel className={classes.label}>Search</InputLabel>
        <OutlinedInput
          placeholder="First, Last, Company, Title"
          value={searchValue}
          label="Search"
          color="primary"
          notched={false}
          endAdornment={<SearchIcon />}
          variant="outlined"
          onChange={(e) => setSearchValue(e.target.value)}
        />
      </InputWrapper> */}
      <TextField
        placeholder="First, Last, Company, Title"
        value={searchValue}
        label="Search"
        color="primary"
        InputLabelProps={{
          shrink: true,
        }}
        inputProps={{
          endAdornment: <SearchIcon />,
        }}
        variant="outlined"
        onChange={(e) => setSearchValue(e.target.value)}
      />
    </FlexWrapper>
  );
};
